                                    height={304}
                                    src={post.image}
                                    className={s.image}
                                    alt={post.image_alt}
                                />
                                <Title order={5} className={s.cardTitle}>
                                    {post.title}
                                </Title>
                                <Text c='dark.2'>{post.updated_at}</Text>
                                <Box mah={150} style={{ overflow: 'hidden' }}>
                                    <Markdown
                                        options={{
                                            overrides: {
                                                p: (props) => (
                                                    <Text
                                                        {...props}
                                                        mah={150}
                                                        style={{
                                                            overflow: 'hidden',
                                                        }}
                                                        className={s.blogText}
                                                        lineClamp={6}
                                                    />
                                                ),
                                                a: (props) => <>{props.children}</>,
                                                blockquote: (props) => (
                                                    <Blockquote
                                                        mah={150}
                                                        py={0}
